import { Nav } from 'react-bootstrap';
import '../../App.css';


const TopBar =() => {
  return (
    <Nav className ="TopBar">
         <NavLink to="/">
                <h1>Logo</h1>
         </NavLink>
        <Bars />

        <NavMenu>
        <NavLink to="/">
                <h1>Logo</h1>
         </NavLink>
        </NavMenu>

    </Nav>
  );
}

export default TopBar ;
